import logo from './logo.svg';
import './App.css';
import {Login} from './Login';
import {Home} from './Home';
import {Navigation} from './Navigation';
import {BrowserRouter,Route,Nav } from 'react-bootstrap';


function App() {
  return (
    <div className="App">
     <BrowserRouter>
      <Navigation/>
      <Switch>
        <Route path='/' component={Home} exact/>
        <Route path='/Login' component={Login}/>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
